import React from 'react';
import { Link } from "react-router-dom";
import {Navbar, Nav, Button, Dropdown} from 'react-bootstrap';
import Logo from '../../../../assets/Site/Brand.svg';


export default function NavBar(props){
    const { currentUser } = props
    return(
        <Navbar variant="secondary" className="d-flex justify-content-center">
            <Navbar.Brand className="mr-1"><Link to ="/"><img src={Logo} alt="Logo" /></Link></Navbar.Brand>
            {currentUser ? (

            <Nav className="container mr-auto">

                {/* Drop Down for the Character Menu */}
                <div className="container mr-auto">

                </div>


                {/* Play Button */}
                <Nav className="mr-auto"><Link to="/Game"><Button>Play</Button></Link></Nav>

                {/* Profile Button */}
                <Nav className="ml-auto"><Link to="/Profile"><Button>Profile</Button></Link></Nav>

                {/* Logout Button */}
                <Button onClick={props.handleLogout} className="ml-3">Logout</Button>         
            </Nav>
            ) : (
            <Nav className="mr-auto">

                <Nav className="ml-3"><Link to ="/SignUp">Sign Up</Link></Nav>

                <Nav className="ml-3"><Link to ="/Login">Login</Link></Nav>

            </Nav>
            )}
        </Navbar>

    )
}
